import './App.css';
import Home from './/Components/Home/Home';
import * as reactRouterDom from 'react-router-dom';
import AboutUs from './/Components/AboutUs/AboutUs';
import FinancialPlanning from './/Components/FinancialPlanning/FinancialPlanning';
import NRI from './/Components/NRI/NRI';
import ContactUs from './/Components/ContactUs/ContactUs';
import Learning from './/Components/Learning/Learning';
import Download from './/Components/Download/Download';

const App = () => {
  return (
    <reactRouterDom.BrowserRouter>
      <Switch>
        <reactRouterDom.Route exact path='/'>
          <Home />
        </reactRouterDom.Route>
        <reactRouterDom.Route exact path='/AboutUs'>
         <AboutUs />
        </reactRouterDom.Route>
        <reactRouterDom.Route exact path='/FinancialPlanning'>
          <FinancialPlanning />
        </reactRouterDom.Route>
        <reactRouterDom.Route eaxct path='/NRI'>
          <NRI />
        </reactRouterDom.Route>
        <reactRouterDom.Route exact path='/Learning'>
          <Learning />
        </reactRouterDom.Route>
        <reactRouterDom.Route exact path='/Download'>
          <Download />
        </reactRouterDom.Route>
        <reactRouterDom.Route exact path='/ContactUs'>
          <ContactUs />
        </reactRouterDom.Route>
      </Switch>
    </reactRouterDom.BrowserRouter>
  );
}

export default App;

// <li><hr class="dropdown-divider" /></li> to put divider
